_text(aes(label = sprintf(\"%.0f\", avg_billing)), color = \"black\", size = 4) +  # annot=True, fmt='.0f'\n","  scale_fill_gradientn(colors = c(\"#edf8b1\", \"#7fcdbb\", \"#2c7fb8\"),  # Similar to 'YlGnBu'\n","                      name = \"Average Billing ($)\") +\n","  labs(title = \"Average Billing Amount ($) by Blood Type and Gender\",\n","       x = \"Gender\",\n","       y = \"Blood Type\") +\n","  theme_minimal() +\n","  theme(plot.title = element_text(hjust = 0.5, face = \"bold\"),\n","        panel.grid = element_blank())\n","ggsave(\"average_billing_amount_by_blood_type_and_gender.png\", width = 12, height = 6, units = \"in\", dpi = 300)"]},{"cell_type":"markdown","id":"f637616c","metadata":{"papermill":{"duration":0.012871,"end_time":"2025-04-25T17:34:46.506604","exception":false,"start_time":"2025-04-25T17:34:46.493733","status":"completed"},"tags":[]},"source":["## Create pie chart to see the Proportion of Total Billing Amount by Gender\n","The result offers a clear of the distribution of the total billing amount based on gender. With males contributing 50.2% and females accounting for 49.8%, the financial input from each gender group is remarkably balanced. While a slight numerical advantage exists for males, the practical difference is minimal, indicating a relatively equitable distribution of healthcare or service costs between the two groups."]},{"cell_type":"code","execution_count":16,"id":"214423b1","metadata":{"execution":{"iopub.execute_input":"2025-04-25T17:34:46.535522Z","iopub.status.busy":"2025-04-25T17:34:46.533924Z","iopub.status.idle":"2025-04-25T17:34:47.610574Z","shell.execute_reply":"2025-04-25T17:34:47.608833Z"},"papermill":{"duration":1.093567,"end_time":"2025-04-25T17:34:47.612827","exception":false,"start_time":"2025-04-25T17:34:46.51926","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["\n","Total Billing Amount by Gender:\n"]},{"name":"stdout","output_type":"stream","text":["\u001b[90m