AAJVQQAMAAAAAUAkFNAAAAAAAlVBAAwAAAABQ\nCQU0AAAAAACVUEADAAAAAFAJBTQAAAAAAJVQQAMAAAAAUAkFNAAAAAAAlVBAAwAAAABQCQU0\nAAAAAACVUEADAAAAAFAJBTQAAAAAAJVQQAMAAAAAUAkFNAAAAAAAlVBAAwAAAABQCQU0AAAA\nAACVUEADAAAAAFAJBTQAAAAAAJVQQAMAAAAAUAkFNAAAAAAAlVBAAwAAAABQCQU0AAAAAACV\nUEADAAAAAFAJBTQAAAAAAJVQQAMAAAAAUAkFNAAAAAAAlVBAAwAAAABQCQU0AAAAAACVUEAD\nAAAAAFAJBTQAAAAAAJVQQAMAAAAAUAkFNAAAAAAAlVBAAwAAAABQCQU0AAAAAACVUEADAAAA\nAFAJBTQAAAAAAJVQQAMAAAAAUAkFNAAAAAAAlVBAAwAAAABQCQU0AAAAAACVUEADAAAAAFAJ\nBTQAAAAAAJVQQAMAAAAAUAkFNAAAAAAAlVBAAwAAAABQCQU0AAAAAACVUEADAAAAAFAJBTQA\nAAAAAJVQQAMAAAAAUAkFNAAAAAAAlVBAAwAAAABQCQU0AAAAAACVUEADAAAAAFAJBTQAAAAA\nAJX4/wS/jvgGJwvpAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"height":480,"width":960}},"output_type":"display_data"}],"source":["\n","# Calculate total billing by gender\n","gender_billing <- df %>%\n","  group_by(Gender) %>%\n","  summarise(total_billing = sum(Billing.Amount, na.rm = TRUE)) %>%\n","  ungroup()\n","\n","# Print the summary table\n","cat(\"\\nTotal Billing Amount by Gender:\\n\")\n","print(gender_billing)\n","\n","# Create pie chart\n","ggplot(gender_billing, aes(x = \"\", y = total_billing, fill = Gender)) +\n","  geom_bar(stat = \"identity\", width = 1, color = \"white\") +\n","  coord_polar(\"y\", start = 0) +\n","  geom_text(aes(label = paste0(round(total_billing/sum(total_billing)*100, 1), \"%\")),\n","            position = position_stack(vjust = 0.5),\n","            size = 6) +\n","  scale_fill_manual(values = c(\"lightgreen\", \"lightblue\")) +\n","  labs(title = \"Proportion of Total Billing Amount by Gender\",\n","       fill = \"Gender\") +\n","  theme_void() +\n","  theme(\n","    plot.title = element_text(size = 22, hjust = 0.5, color = \"black\"),\n","    legend.position = \"right\"\n","  )  # This closing parenthesis was missing\n","\n","ggsave(\"total_billing_amount_by_gender.png\", width = 12, height = 6, units = \"in\", dpi = 300)"]},{"cell_type":"markdown","id":"d9b319ba","metadata":{"papermill":{"duration":0.013939,"end_time":"2025-04-25T17:34:47.64127","exception":false,"start_time":"2025-04-25T17:34:47.627331","status":"completed"},"tags":[]},"source":["#  Annual Billing Amount by Gender (2019-2024)\n","* **Comparison by Gender:**\n","    * In `2019`, the total billing amount for `females ($95.9M)` was slightly higher than that for `males ($94.0M)`.\n","    * From `2020` to `2023`, the total billing amount for males `consistently exceeded` that of females. The difference appears most significant in 2020: *146.7M for Males VS. 139.9M for Females in USD.*\n","    * In `2024`, the trend reverses again, with the total billing amount for `females ($47.4M)` being `slightly lower` than that for `males ($50.4M)`, but both are significantly lower than the preceding years.\n","\n","<b>Peak Billing:</b> The highest total billing amount for males occurred in 2020 ($146.7M), while for females, it also peaked in `2020 ($139.9M)`.\n","\n","<b>Significant Drop in 2024:</b> There is a substantial decrease in the total billing amount for both genders in 2024 compared to the previous years, suggesting a significant change in billing patterns or volume during that year."]},{"cell_type":"code","execution_count":17,"id":"87556257","metadata":{"execution":{"iopub.execute_input":"2025-04-25T17:34:47.67251Z","iopub.status.busy":"2025-04-25T17:34:47.670861Z","iopub.status.idle":"2025-04-25T17:34:48.771041Z","shell.execute_reply":"2025-04-25T17:34:48.769245Z"},"papermill":{"duration":1.118357,"end_time":"2025-04-25T17:34:48.77336","exception":false,"start_time":"2025-04-25T17:34:47.655003","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAB4AAAAPACAIAAABb1/PuAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZUBUWRsH8OdOwcDQDQKC2C2ImGCvsa5ir93d7dotdq+NHWt3dycoNoqIqCDS\nOfl+GB2HmWEYeBkH9f/7BOeeupcrMs899zmMTCYjAAAAAAAAAAAAAICCxjL0BAAAAAAAAAAA\nAADg14QANAAAAAAAAAAAAADoBQLQAAAAAAAAAAAAAKAXCEADAAAAAAAAAAAAgF4gAA0AAAAA\nAAAAAAAAeoEANAAAAAAAAAAAAADoBQLQAAAAAAAAAAAAAKAXCEAD