abels = label_dollar(scale = 1/1000, suffix = \"K\")\n","  ) +\n","  geom_text(\n","    aes(label = dollar(Billing.Amount, scale = 1/1000, suffix = \"K\")),\n","    position = position_dodge(width = 0.9),\n","    vjust = -0.5,\n","    size = 3.5\n","  ) +\n","  labs(\n","    title = \"Annual Billing Amount by Gender (2019-2024)\",\n","    x = \"Year\",\n","    y = \"Total Billing Amount\",\n","    fill = \"Gender\"\n","  ) +\n","  theme_minimal() +\n","  theme(\n","    panel.grid.major = element_blank(),\n","    panel.grid.minor = element_blank(),\n","    plot.title = element_text(\n","      size = 16, \n","      hjust = 0.5, \n","      margin = unit(c(0, 0, 20, 0), \"pt\")  # Using unit() instead of margin()\n","    ),\n","    axis.title = element_text(size = 12),\n","    axis.text = element_text(size = 10),\n","    legend.title = element_text(size = 12),\n","    legend.text = element_text(size = 11),\n","    panel.background = element_rect(fill = \"white\", color = NA)\n","  )\n","\n","# Saving the plot\n","ggsave(\"total_billing_amount_by_gender.png\", width = 12, height = 6, units = \"in\", dpi = 300)"]},{"cell_type":"markdown","id":"b2c7ceb8","metadata":{"papermill":{"duration":0.015506,"end_time":"2025-04-25T17:34:48.804758","exception":false,"start_time":"2025-04-25T17:34:48.789252","status":"completed"},"tags":[]},"source":["## Gender & Insurance Provider\n","The following analysis focuses on understanding the relationship between `gender` and `insurance providers`. Specifically, we aim to identify which insurance providers are more commonly associated with male or female patients. By examining the distribution of patients across different insurance providers, segmented by gender, we can gain insights into potential trends or patterns in healthcare coverage preferences or accessibility. This analysis will help us better understand the demographic composition of patients under various insurance providers."]},{"cell_type":"code","execution_count":18,"id":"32b0