AQCQE0AAA\nAAAAREIADQAAAABAJATQAAAAAABEQgANAAAAAEAkBNAAAAAAAERCAA0AAAAAQCQE0AAAAAAA\nREIADQAAAABAJATQAAAAAABEQgANAAAAAEAkBNAAAAAAAERCAA0AAAAAQCQE0AAAAAAAREIA\nDQAAAABAJATQAAAAAABEQgANAAAAAEAkBNAAAAAAAERCAA0AAAAAQCQE0AAAAAAAREIADQAA\nAABAJATQAAAAAABEQgANAAAAAEAkBNAAAAAAAETi/wGUku1LY+ekowAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"height":480,"width":960}},"output_type":"display_data"}],"source":["# Clean insurance provider names\n","df <- df %>%\n","  mutate(Insurance.Provider = trimws(Insurance.Provider))\n","\n","# Create the plot\n","ggplot(df, aes(x = fct_infreq(Insurance.Provider), fill = Gender)) +\n","  geom_bar(position = position_dodge(preserve = \"single\"), \n","           color = \"white\", \n","           width = 0.7) +\n","  scale_fill_hue() +  # Similar to 'husl' palette\n","  geom_text(\n","    aes(label = after_stat(count)),\n","    stat = \"count\",\n","    position = position_dodge(width = 0.7),\n","    vjust = -0.5,\n","    size = 3.5\n","  ) +\n","  labs(\n","    title = \"Insurance Provider Distribution by Gender\",\n","    x = \"Insurance Provider\",\n","    y = \"Number of Patients\",\n","    fill = \"Gender\"\n","  ) +\n","  theme_minimal() +\n","  theme(\n","      panel.grid.major = element_blank(), \n","    panel.grid.minor = element_blank(),\n","    plot.title = element_text(\n","      size = 16,\n","      hjust = 0.5,\n","    # top, right, bottom, left\n","      margin = unit(c(0, 0, 20, 0), \"pt\")  \n","    ),\n","    plot.margin = unit(c(1, 1, 1, 1), \"cm\"),\n","  )\n","\n","# Saving the plot\n","ggsave(\"Insurance_provider_distribution_by_gender.png\", width = 12, height = 6, units = \"in\", dpi = 300)"]},{"cell_type":"markdown","id":"f7b7b727","metadata":{"papermill":{"duration":0.016103,"end_time":"2025-04-25T17:34:50.479751","exception":false,"start_time":"2025-04-25T17:34:50.463648","status":"completed"},"tags":[]},"source":["### Insurance Provider Market Share by Gender Over Time\n","In the above visualization, we consolidate