                      shape = Gender)) +\n","  geom_line(linewidth = 1.2) +  # Fixed: using linewidth instead of size\n","  geom_point(size = 3) +\n","  scale_color_hue() +\n","  scale_linetype_manual(values = rep(\"solid\", length(unique(trend_data$Gender)))) +\n","  labs(\n","    title = \"Insurance Provider Trends by Gender (2019-2024)\",\n","    x = \"Year\",\n","    y = \"Percentage of Patients (%)\"\n","  ) +\n","  theme_minimal() +\n","  theme(\n","    panel.grid.major = element_blank(),\n","    panel.grid.minor = element_blank(),\n","    panel.grid.major.y = element_line(color = \"gray90\"),\n","    plot.title = element_text(\n","      size = 20, \n","      hjust = 0.5, \n","      margin = unit(c(0, 0, 20, 0), \"pt\")  # Fixed: using unit() instead of margin()\n","    ),\n","    legend.position = \"right\",\n","    legend.box = \"vertical\",\n","    axis.text = element_text(size = 10),\n","    axis.title = element_text(size = 12)\n","  )\n","\n","# Faceted plots with fixes\n","ggplot(trend_data, aes(x = Year, y = Percentage, color = Gender)) +\n","  geom_line(linewidth = 1.2) +  # Fixed: using linewidth\n","  geom_point(size = 2) +\n","  facet_wrap(~ InsuranceProvider, ncol = 3) +\n","  scale_color_hue() +\n","  labs(\n","    title = \"Insurance Provider Market Share by Gender Over Time\",\n","    x = \"Year\",\n","    y = \"Percentage (%)\"\n","  ) +\n","  theme_minimal() +\n","  theme(\n","    plot.title = element_text(\n","      size = 16, \n","      hjust = 0.5, \n","      margin = unit(c(0, 0, 15, 0), \"pt\")  # Fixed: using unit()\n","    ),\n","    strip.text = element_text(size = 10, face = \"bold\"),\n","    legend.position = \"top\"\n","  )\n","\n","# Saving the plot\n","ggsave(\"Insurance_provider_market_share_by_gender.png\", width = 12, height = 6, units = \"in\", dpi = 300)"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":7122073,"sourceId":11375931,"sourceType":"datasetVersion"},{"datasetId":7225449,"sourceId":1152082